import React from 'react';
import './App.css';
import Info from "./components/Info";
import Data from "./components/Data";



function App() {
  return (
      <div className='wrapper'>
          <div className='main'>
        <Info></Info>
        <Data></Data>
      </div>
      </div>
  );
}

export default App;
